import React, {Component} from "react";
import "./table.css";
import icon from "./img/icon.png"

class Table extends Component{
    constructor(props){
        super(props)
    }

    componentDidMount(){
        console.log(this.props.db_name)
    }

    render(){
        return(
            <div className="table">
                <div className="main_wind">
                    <div className="top">
                        <img src={icon} className="icon"/>
                        <h3 className="title">Пшеница мягкая озимая</h3>
                        <div className="search">
                            <input
                                type="text"
                            />
                            <button></button>
                        </div>
                        <button className="close"></button>
                    </div>
                </div>
            </div>
        )
    }
}

export default Table
